import React from "react";
import { ItemWrapper } from "./styles";
import PropTypes from "prop-types";

const Product = ({ item }) => {
  return (
    <ItemWrapper>
      <span>Tets</span>
    </ItemWrapper>
  );
};

Product.propTypes = {
  item: PropTypes.object,
};

export default Product;
